sys_variable_value.value:
(function execute(inputs, outputs) {

  var attachment = new GlideSysAttachment();
  var rec = new GlideRecord("x_g_dis_atat_acquisition_package");
  var incidentSysID = inputs.acq_package;
  rec.get(incidentSysID);
  var fileName = inputs.file_name;
  var contentType = inputs.content_type;
  var base64Encodedcontent = inputs.binary_string;

  var agr = attachment.writeBase64(rec, fileName, contentType, base64Encodedcontent);

  gs.info("The attachment sys_id is: " + agr);

})(inputs, outputs);

